import React, { Component, Fragment } from 'react';

class NavBar extends Component {
  render(){
    return(
    <>
      <ul>
        <li>Home</li>
        <li>Book A Customer</li>
        <li>View All Bookings</li>
      </ul>
    </>
  )
  }

}

export default NavBar;
